import React, { Component } from 'react'
import Img from '../../../assets/images/profile.jpg'

class Info extends Component {
    render() {
        return (
            <div className='info d-flex justify-content-between align-items-center gap-2'>
                <div className='img'>
                    <img src={Img} alt="profile" className='rounded-5' />
                </div>
                <div className='details'>
                    <span className='bg-pink p-2 rounded-4 text-white'>offline</span>
                    <h3>alan smithee</h3>
                </div>
            </div>
        )
    }
}

export default Info;
